    value: "After a recent internal audit of Pryce for Congress, it was discovered
      that an inaccurate 2008 Year End report was inadvertently submitted to the FEC
      through our electronic filing software.  The committee had every intention of
      filing the report that was filed as an amendment on August 26, 2009, but due
